import {useState} from 'react';

const Cidade = ({nome, quantidadeVotos, contadorVotos}) => {
     [quantidadeVotos, contadorVotos] = useState(0);
     return function() {
          return (
               <>
                    <button onClick={() => contadorVotos(prev => prev + 1)}>{nome}</button>
               </>
          );
     }
};

export default Cidade;
